.aboutTheTeam {
  background-color: #a0adbd;
  height: 100%;
}

.aboutTheTeam h1 {
  text-align: center;
  padding: 50px 0px;
  color: #fff;
  text-transform: uppercase;
}

.container {
  display: flex;
  align-items: center;
  justify-content: center;
}

.teamImage {
  border: 15px solid #405777;
  border-radius: 4px;
  max-width: 500px;
}

.aboutUsText {
  font-size: 20px;
  padding-left: 40px;
  padding-right: 60px;
}

.image {
  padding-left: 60px;
}

.readMore {
  background-color: #405777;
  border: none;
  color: white;
  padding: 10px 24px;
  text-align: center;
  text-decoration: none;
  display: inline-block;
  font-size: 16px;
}

.readMore:hover {
  background-color: #4f6b92;
}

.readMoreButton {
  padding-top: 15px;
  display: flex;
  align-items: center;
  justify-content: center;
}

/*-- services --*/
* {
  box-sizing: border-box;
}

.servicesTitle {
  text-align: center;
  padding: 50px 0px;
  color: #fff;
  text-transform: uppercase;
  background-color: #a0adbd;
}

.servicesContainer {
  width: 25%;
  float: left;
  padding: 0 10px;
}

.services {
  background-color: #a0adbd;
  display: flex;
  justify-content: space-evenly;
  padding-bottom: 50px;
  flex-wrap: wrap;
}

.content {
  box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2);
  padding: 16px;
  text-align: center;
  background-color: #405777;
  color: #fff;
  border-radius: 5px;
}

.readMoreServices button {
  background-color: #405777;
  border: none;
  color: white;
  padding: 10px 24px;
  text-align: center;
  text-decoration: none;
  font-size: 16px;
}

.readMoreServices button:hover {
  background-color: #4f6b92;
}

.readMoreServices {
  background-color: #a0adbd;
  display: flex;
  justify-content: center;
}

/*-- gallery --*/
.gallerySection {
  background-color: #a0adbd;
}

.galleryTitle {
  text-align: center;
  padding: 50px 0px;
  color: #fff;
  text-transform: uppercase;
  background-color: #a0adbd;
}

#gallery {
  background-color: #a0adbd;
  display: grid;
  grid-template-columns: 1fr 1fr 1fr;
  grid-gap: 20px;
  align-items: stretch;
  justify-items: center;
  margin: 0px 40px 0px;
  position: relative;
}

.galleryEffect {
  position: relative;
}

.galleryEffect .photoDescription {
  position: absolute;
  right: 0;
  bottom: 0;
  color: #fff;
  margin: 3em;
  padding: 0 1em;
  border-right: 4px solid #fff;
  text-align: right;
  opacity: 0;
  -webkit-transition: opacity 0.35s;
  transition: opacity 0.35s;
}

.galleryEffect:hover {
  cursor: pointer;
}

.galleryEffect:hover .photoDescription {
  padding: 8px 15px;
  visibility: visible;
  opacity: 1;
}

.galleryEffect:hover img {
  -webkit-transform: scale3d(1, 1, 1);
  -moz-transform: scale3d(1, 1, 1);
  -o-transform: scale3d(1, 1, 1);
  -ms-transform: scale3d(1, 1, 1);
  transform: scale3d(1, 1, 1);
  opacity: 0.3;
}

#gallery img {
  max-width: 100%;
  vertical-align: middle;
  object-fit: cover;
  box-shadow: 2px 2px 6px 0px rgba(0, 0, 0, 0.3);
}

